function loopingIcons(iconContainer, icon){
    var animation = lottie.loadAnimation({
        container: document.getElementById(iconContainer),
        renderer: 'svg',
        loop: true,
        autoplay: true,
        backgroundColor:"aqua",
        animationData: icon,
    });
    animation.addEventListener('DOMLoaded', () => {
        const svgElement = document.getElementById(iconContainer).getElementsByTagName('svg')[0];
        
        // Change the fill color of the paths in the SVG
        svgElement.querySelectorAll('path').forEach((path) => {
            path.setAttribute('fill', '#FF0000'); // Change the icon color to red
        });
    });
}

